import { storage } from "./firebase";


function Home() {
    const[imagelist,setimagelist] = useState([]);
    const imagelistref = ref(storage,"Post/");
    useEffect(()=>{
        listAll(imagelistref).then((response)=>{
         console.log(response);
        })
    },[])
    return ( 
        <div>
            <Navbar/>
            <div className="post">
            {imagelist.map((url)=>{
               return <img src= {url} />;
            })}
            </div>
        </div>
        
     );
}

export default Home;
